import React from 'react'
let ProfileStyle = {
  div: {
    backgroundColor: '#eeeeee',
    height: '660px',
    width: '100%',
    textAlign: 'center',
    float: 'left',
  },
}
export const Profile = () => {
  return (
    <div style={ProfileStyle.div}>
      <span>This is the Profile Page</span>
    </div>
  )
}
